import React from 'react'
import Question from '../../components/Question.js'
import Star1 from '../../img/star1.png'
import Star2 from '../../img/star2.png'

const faqs = [
  {id: 'a', no: 1, ques: 'Why choose Opam?', ans: 'Asik'},
  {id: 'a', no: 2, ques: 'Why choose Opam?', ans: 'Asik'},
  {id: 'a', no: 3, ques: 'Why choose Opam?', ans: 'Asik'},
  // {id: 'a', no: 4, ques: 'Why choose Opam?', ans: 'Asik'},
  // {id: 'a', no: 5, ques: 'Why choose Opam?', ans: 'Asik'},
];

const FAQ = () => {
  return (
    <div className='h-max-screen flex flex-col justify-center p-16 font-prata bg-[#21201D]'>
      <div className='flex justify-evenly px-24 pb-24'>
        <div className='grid items-center'><img src={Star1} alt='star'/></div>
        <h1 className='text-2xl lg:text-5xl prim-color grid items-center'>Frequently Asked Questions</h1>
        <div className='grid items-center'><img src={Star2} alt='star'/></div>
      </div>

      <div className='faq'>
        <div>
          {faqs.map(({id, no, ques, ans}) => {
            <Question no={no} ques={ques} ans={ans}/>
          })}
        </div>
      </div>
    </div>

  )
}

export default FAQ

